(29820, 24997, 0, 3, '沒人在家(No one''s there)試聽(demo)', '試聽版\r\n\r\n敬請期待收錄於EP之完整版本', '2010-11-28 00:00:00', 2010, 10, 0, 9, 'please take my fuck''n brains out\r\n請拿走我的大腦\r\nthan you know the whole things I know,I don''t wanna know\r\n你就會知道所有我不想知道的事情\r\nthey made the silent Murder Machine\r\n他們製造沉默的殺人機器來抹除我的想法\r\nto kill my think''in and stop my breath for them\r\n並讓我為了他們停止呼吸\r\n\r\nthey made the silent Murder Machine\r\n他們製造沉默的殺人機器來抹除我的想法\r\nto kill my think''in  \r\n並讓我為了他們停止呼吸\r\n\r\nI can''t believe you don''t care me anymore\r\n我無法相信你不再在乎我  \r\n\r\nI can''t believe you wanna leave along\r\n我也無法相信你要遠遠的離開我\r\n', '', 98, '', '說書人', '說書人', '說書人', '說書人', '', 0, 0, 1, '2010-11-28 22:47:41', '2013-10-07 17:17:26', '0000-00-00 00:00:00'),
(29821, 58994, 0, 1, '賣魚的人_魚骨Live', '這首剛寫完一天就直接拿去表演了。\r\n出鎚的地方還不算少，還請多多包含。(傻笑)', '2010-11-28 00:00:00', 2010, 0, 2, 5, '你兜售著自己的魚\r\n擔心著沒人光臨\r\n大聲叫喊 大顆汗滴\r\n就怕被看穿內心著急\r\n\r\n\r\n你兜售著自己的魚\r\n想盡辦法推銷出去\r\n給你建議偏偏不聽\r\n殘喘求生你最容易\r\n\r\n如果你繼續只想到自己\r\n如果你不懂得珍惜建議\r\n如果你故作輕鬆自在\r\n我奉陪你這個把戲\r\n\r\n如果你繼續只想到自己\r\n如果你不懂得珍惜建議\r\n我只是還沒提醒 \r\n早就看穿你無聊的把戲\r\n\r\n\r\n來喔 來喔 來買魚\r\n我的魚是最上等級\r\n來喔 來喔 來買魚\r\n歡迎你再度光臨\r\n\r\n來喔 來喔 來買魚\r\n我的魚是最上等級\r\n來喔 來喔 來買魚\r\n我就是那個selfish', '', 184, '', '', '', '', '', '', 0, 1, 0, '2010-11-28 23:43:28', '2015-03-12 13:44:37', '0000-00-00 00:00:00'),
(29822, 58994, 0, 1, '來去菜市場_魚骨Live', '魚骨Bootleg第二彈\r\n就是要聽起來毫不修飾才是bootleg啊 (牽拖)', '2010-11-29 00:00:00', 2010, 0, 2, 5, '睡到下午兩點\r\n肚子咕嚕咕嚕的叫\r\n\r\n桌上沒有食物等我 (沒有 沒有)\r\n所以我決定\r\n來去菜市場\r\n買一大堆的豬肉 (喔喔 喔喔)\r\n\r\n拉拉扯扯過後\r\n討價還價過後\r\n免強施捨我兩根蔥(給我 給我)\r\n\r\n逛了一小時左右\r\n每個攤位都說\r\n老闆哭了 大跳樓\r\n\r\n---\r\n\r\n來去菜市場 (lalala lala lala)\r\n來去菜市場 (lalala lala lala)\r\n\r\n鹹水雞來兩盤好嘛?\r\n (蘿蔔:分你吃 分你吃)\r\n (大樂:有夠鹹 有夠鹹)\r\n\r\n臭豆腐叫大辣好嘛? \r\n(蘿蔔:很夠味 很夠味)\r\n(大樂:不錯吃 不錯吃)\r\n\r\n銅鑼燒別包餡好嘛?\r\n(蘿蔔:你吃皮 你吃皮)\r\n(大樂:有夠乾 有夠乾)\r\n\r\n麥芽膏黏牙齒好嘛? \r\n(蘿蔔:甜肳肳 甜肳肳)\r\n(大樂:看牙醫 看牙醫)\r\n\r\n 看牙醫～看牙醫～\r\n\r\n----\r\n\r\n來去菜市場～\r\n市場老板娘真漂亮～\r\n\r\n(主歌repeat)\r\n\r\n\r\n\r\n甜不辣炸咖久賀嘛? \r\n蘿蔔:變好硬 變好硬 \r\n大樂:臭灰搭 臭灰搭\r\n\r\n蚵仔煎來三斤賀嘛? \r\n(蘿蔔:金營養 金營養)\r\n(大樂:乓乓叫 乒乓叫)\r\n\r\n紅豆餅別算錢好嘛? \r\n(蘿蔔:我也要 我也要)\r\n(大樂:一起帶 一起帶)\r\n\r\n老闆女兒嫁我好嘛? \r\n(蘿蔔:你作夢 你作夢) \r\n(大樂:免肖想 免肖想)\r\n\r\n免肖想 免肖想 免肖想 免肖想\r\n\r\n\r\n來去菜市場\r\n市場老板娘真漂亮\r\n來去菜市場\r\n市場老板娘真漂亮', '', 242, '', '', '', '', '', '', 0, 1, 0, '2010-11-29 00:38:56', '2015-03-12 13:44:37', '0000-00-00 00:00:00'),
