(29825, 88419, 0, 1, '01 明日的序', '', '2010-05-01 00:00:00', 2000, 0, 2, 7, '孩子　為了未來高聲呼叫\r\n國衰退　家雖變　我在戰\r\n\r\n純知識壯志　而捨己救治　未置身先示意\r\n亡天的罪　轟炸帶淚　與懼身軀決問誰昏睡\r\n\r\n窮蘊釀心交瘁　難以絕對跟隨　恨不把持權力爭據\r\n\r\n退　這使命有無法後退的序\r\n血淚曾流未了抱負死去\r\n到最後愧讓愛伴隨\r\n我想追　明日讓我活下去　問誰\r\n \r\n無知不理智　言痴式對峙　誰狂唸己詞\r\n如此不盡　根理性論　最內心呼喊自由的淚\r\n \r\n磨折令家粉碎　難以絕對跟隨　仍然未醒如何來喚醒頹\r\n\r\n退　這使命有無法後退的序\r\n血淚曾流未了抱負死去\r\n到最後愧讓愛伴隨\r\n我想追　明日願撐下去\r\n\r\n充斥惡耗力挽救獲勝的路\r\n不安國度倘有氣焰刺激發命途\r\n窮追　跌倒　遺留沒有在逃\r\n\r\n退　這使命有無法後退的序\r\n血淚曾寫下了抱負一句\r\n到最後叫喚愛伴隨\r\n我想追　明日讓我活下去', '', 240, '', 'Wilson Chow & Bon Yip', 'Jero Ng', 'Sinfonia', '', '', 0, 1, 0, '2010-11-29 06:22:38', '2015-03-12 13:44:37', '0000-00-00 00:00:00'),
(29826, 88419, 0, 1, '02 負差異 (Live Version)', '', '2010-05-01 00:00:00', 2000, 0, 2, 7, '歪曲了處事的裝置　如此　蒙蔽存活也沒意義\r\n基本以面容核算不同　誰懂　無法在亂世分次對攻\r\n\r\n空隙之中　求存要跨越每寸裂縫\r\n催促的風　隨連每一秒鐘都操縱\r\n然而貧窮　誰能訣別嘲諷　誰還要服從\r\n\r\n外在誰扮聾扮瘋\r\n內在無自容負差可見痛\r\n誰讚頌　面對面說出眾\r\n沒路唯道遊下衝\r\n唸著陳舊唇調腔聲太重\r\n自卑中的困局\r\n \r\n曲解了意義作用詞　無知　凡人才沒有力透視\r\n分析了內容定理相容　其中　無數留在腦海裡揭衷\r\n\r\n漆黑之中　行前要爭奪每寸認同\r\n卑躬的攻　從力壓掙脫得出失控\r\n然而貧窮　誰能訣別嘲諷　誰還要服從\r\n\r\n外在誰扮聾扮瘋\r\n內在無自容負差可見痛\r\n誰讚頌　沒法自我操控\r\n沒路唯道遊下衝\r\n唸著陳舊唇調腔聲太重\r\n若必須拾回勇\r\n\r\n外在誰扮誰扮瘋\r\n內在無自容負差可見痛\r\n誰讚頌　設法自我擊中\r\n沒路唯道仍是衝\r\n唸著華麗唇調腔聲太重\r\n若必須拾回勇', '', 266, '', 'Wilson Chow & Bon Yip', 'Jero Ng', 'Sinfonia', '', '', 0, 1, 0, '2010-11-29 06:23:16', '2015-03-12 13:44:37', '0000-00-00 00:00:00'),
(29827, 88419, 0, 1, '03 沉 (Live Version)', '', '2010-05-01 00:00:00', 2000, 0, 2, 4, '沉　情況不堪　依負著誰人\r\n裂痕　誰甘心多處也在滲\r\n仍是暗　誰不得不抗奮\r\n毫無疑問誰的怒憤　抱住卻沒法喚來\r\n\r\n餘溫　困在腦海裡未能　繼續流失再下沉\r\n\r\nIt’s all I Can　撐到盡沒法再保留　我妄想誰能夠\r\nIt’s all I Care　一切若沒法再擔憂　圍守擠空的氣流\r\n\r\n無法握緊　追逐著靈魂\r\n淚痕　難堪沖不去的烙印\r\n如地震　窮不得不氣憤\r\n同行成全別人的步韻　抱住卻沒法喚來\r\n\r\n餘溫　困著腦海裡未能　繼續流失再下沉\r\n\r\nIt’s all I Can　撐到盡沒法再保留　我妄想誰能夠\r\nIt’s all I Care　一切若沒法再擔憂　餘生　但求　還有\r\n\r\n原因　困著腦海裡未能　繼續流失再下沈 \r\n\r\nIt’s all I Can　撐到盡沒法再保留　我妄想誰能夠\r\nIt’s all I Care　一切若沒法再擔憂　餘生　但求　還有\r\nIt''s all I Can...\r\nIt''s all I Care...', '', 271, '', 'Wilson Chow', 'Jero Ng', 'Sinfonia', '', '', 0, 0, 1, '2010-11-29 06:23:53', '2013-10-07 17:17:27', '0000-00-00 00:00:00'),
(29828, 88419, 0, 1, '04 同化 (Live Version)', '', '2010-05-01 00:00:00', 2000, 0, 2, 4, '踏過的時空　目送浪費的痛\r\n若歲月憑空　也想不出會懂作夢\r\n\r\n亂世給掏空　情節挫世態撃倒煙虹\r\n漣漪彷似不窮　人飄落無用　似瘋亂動我怎操縱\r\n\r\n同化　縱不怕失控了嗎\r\n遺留無餘自胚芽\r\n誰願變化　成就也最起碼優雅\r\n同化　吝嗇可怕喻何價\r\n似蒸發再被溶化　無暇\r\n誰的徬徨　成灰燼記下\r\n\r\n歷劫多年空　目送賺過的勇\r\n讓歲月流沖　永遠都不會懂惡夢\r\n \r\n腐化的寒冬　磨折破世界得到滄容\r\n蓮凋彷似枯松　誰惜別凝重　似瘋亂動我怎操縱\r\n\r\n同化　縱不怕失控了嗎\r\n遺留無餘自胚芽\r\n誰願變化　成就也最起碼優雅\r\n同化　吝嗇可怕喻何價\r\n似蒸發再被溶化　無暇\r\n誰的徬徨　和不安溶化\r\n\r\n燃燒的瘡疤　延伸的偏差　由它全力割下\r\n\r\n同化　縱不怕失控了嗎\r\n遺留無餘自胚芽\r\n誰願變化　成就也最起碼優雅\r\n同化　吝嗇可怕喻何價\r\n似蒸發再被溶化　無暇\r\n誰的徬徨　成灰燼也罷', '', 292, '', 'Wilson Chow', 'Jero Ng', 'Sinfonia', '', '', 0, 0, 1, '2010-11-29 06:24:34', '2013-10-07 17:17:27', '0000-00-00 00:00:00'),
