(29848, 87852, 0, 1, '空白深刻', '', '2010-11-29 00:00:00', 2000, 0, 1, 7, '剛下過雨的夜晚我一個人 喝了些酒\r\n太不能夠對誰坦白  或者說 這氣氛不太適合討論 感情 \r\n瀰漫詩意的星辰灑滿天際 好不燦爛  \r\n我一個人顯得孤單  或者說 這景色不太容許一人 觀賞\r\n\r\n是我 不該沉醉 不該停留 還沒遺忘 不該對你有一點留戀 我承認我無法善變\r\n\r\n在不過簡單就是一個回答 在我看來\r\n只是你想得過於複雜 或者說 你的世界存在太多的 考慮\r\n刻意的掩藏只是一道最後的堅牆 擋住潰堤\r\n你不懂 沒人說 只能封印在深白色的 情緒\r\n\r\n是我 不該沉醉 不該停留 還沒遺忘 不該對你有一點留戀 那一段空白深刻\r\n\r\n深白色空間 浮現在眼前 熟悉的氣味 慢慢地搖遠 \r\n沒辦法靠近 沒辦法觸摸這傷心的白色 太過傷心的白色 太過傷心的白色\r\n\r\n是我 不該沉醉 不該停留 還沒遺忘 不該對你有一點留戀 我承認我無法善變\r\n是我 不該沉醉 不該停留 還沒遺忘 不該對你有一點留戀 那一段空白深刻', '', 272, '', 'V', 'V', 'V', '', '', 0, 0, 1, '2010-11-29 11:47:15', '2013-10-07 17:17:27', '0000-00-00 00:00:00'),
