(29851, 59066, 0, 1, '給親愛的小太陽(迴響live)', '寫給一個在今年夏天獨自去雲南旅行的女孩\r\n \r\n今年是我們認識的第六年\r\n時間過得太快 像啤酒泡沫一樣\r\n還是一起走到了現在\r\n \r\n你總是希望成為別人的小太陽\r\n卻忘了溫暖的擁抱自己\r\n你總是念著夏宇的那首詩\r\n你是霧 我是酒館\r\n我不知道未來的樣子 也不知道我們還會一起經過多少風景\r\n在你去尋找香格里拉的日子裡\r\n我在台灣為你唱了這首歌\r\n希望你一切都好\r\n \r\n送給一個心中有個炙熱太陽的女孩\r\n也送給每個正在為夢想奮不顧身的人\r\n  ', '2010-11-29 00:00:00', 2000, 0, 1, 7, '給親愛的小太陽\r\n\r\n詞曲:雁子 編曲:小板凳樂團\r\n  \r\n一樣的門 開了又關\r\n站在聲響裡 為小事開心\r\n在杯子裡醒來 傳過香氣\r\n記憶的紙箱 和玫瑰有關\r\n加上整顆方糖 現實等於夢\r\n泡沫般消失 時間不過如此\r\n霧或是酒館 酒館或者是霧\r\n我們是一扇回應彼此的門\r\n \r\nhey my dear little sunshine\r\n牽著狗狗一起走\r\nhey my dear little sunshine\r\n答應我 煩惱留在昨天\r\n', '', 215, '', '雁子', '雁子', '', '', '', 0, 1, 0, '2010-11-29 16:49:06', '2015-03-12 13:44:38', '0000-00-00 00:00:00'),
(29852, 83259, 0, 1, '黑光樂團-黑光', '卸下假面的五個人\r\n變身成為狂傲不羈的黑光!\r\n', '2010-11-29 00:00:00', 2000, 0, 1, 1, '看不清這個世界光明的地方\r\n書本裡教的道理只能靠想像\r\n我認識的這個社會他依舊是這樣\r\n黑暗  \r\n存在  \r\n光明呢\r\n我不是在這裡無病呻吟\r\n只是想傳達一個特別的主義傳達在這裡\r\n\r\n我的態度狂傲不羈\r\n沒有人可以抹煞我的決定\r\n就算你有千百萬種道理\r\n勝利的堅持我相信\r\n就算你覺得沒有任何意義\r\n我還是將我的雙手舉起\r\n音樂是我們的生命\r\n踩下那前進的痕跡', '', 286, '', '鄒松佑.陳進中', '鄒松祐.陳進中', '黑光樂團', '', '', 0, 1, 0, '2010-11-29 17:30:16', '2015-03-12 13:44:38', '0000-00-00 00:00:00'),
