(29854, 88419, 0, 48, '03 沉 (Live Version)', '', '2010-05-01 00:00:00', 2000, 0, 2, 7, '沉　情況不堪　依負著誰人\r\n裂痕　誰甘心多處也在滲\r\n仍是暗　誰不得不抗奮\r\n毫無疑問誰的怒憤　抱住卻沒法喚來\r\n \r\n餘溫　困在腦海裡未能　繼續流失再下沉\r\n \r\nIt’s all I Can　撐到盡沒法再保留　我妄想誰能夠\r\nIt’s all I Care　一切若沒法再擔憂　圍守擠空的氣流\r\n \r\n無法握緊　追逐著靈魂\r\n淚痕　難堪沖不去的烙印\r\n如地震　窮不得不氣憤\r\n同行成全別人的步韻　抱住卻沒法喚來\r\n \r\n餘溫　困著腦海裡未能　繼續流失再下沉\r\n \r\nIt’s all I Can　撐到盡沒法再保留　我妄想誰能夠\r\nIt’s all I Care　一切若沒法再擔憂　餘生　但求　還有\r\n \r\n原因　困著腦海裡未能　繼續流失再下沈 \r\n ﻿\r\nIt’s all I Can　撐到盡沒法再保留　我妄想誰能夠\r\nIt’s all I Care　一切若沒法再擔憂　餘生　但求　還有\r\nIt''s all I Can...\r\nIt''s all I Care...', '', 270, '', 'Wilson Chow & Bon Yip', 'Jero Ng', 'Sinfonia', '', '', 0, 1, 0, '2010-11-29 19:48:22', '2015-03-12 13:44:38', '0000-00-00 00:00:00'),
(29855, 88419, 0, 48, '04 同化 (Live Version)', '', '2010-05-01 00:00:00', 2000, 0, 2, 7, '踏過的時空　目送浪費的痛\r\n若歲月憑空　也想不出會懂作夢\r\n \r\n亂世給掏空　情節挫世態撃倒煙虹\r\n漣漪彷似不窮　人飄落無用　似瘋亂動我怎操縱\r\n \r\n同化　縱不怕失控了嗎\r\n遺留無餘自胚芽\r\n誰願變化　成就也最起碼優雅\r\n同化　吝嗇可怕喻何價\r\n似蒸發再被溶化　無暇\r\n誰的徬徨　成灰燼記下\r\n \r\n歷劫多年空　目送賺過的勇\r\n讓歲月流沖　永遠都不會懂惡夢\r\n \r\n腐化的寒冬　磨折破世界得到滄容\r\n蓮凋彷似枯松　誰惜別凝重　似瘋亂動我怎操縱\r\n \r\n同化　縱不怕失控了嗎\r\n遺留無餘自胚芽\r\n誰願變化　成就也最起碼優雅\r\n同化　吝嗇可怕喻何價\r\n似蒸發再被溶化　無暇\r\n誰的徬徨　和不安溶化\r\n \r\n燃燒的瘡疤　延伸的偏差　由它全力割下\r\n \r\n同化　縱不怕失控了嗎\r\n遺留無餘自胚芽\r\n誰願變化　成就也最起碼優雅\r\n同化　吝嗇可怕喻何價\r\n似蒸發再被溶化　無暇\r\n誰的徬徨　成灰燼也罷', '', 292, '', 'Wilson Chow', 'Jero Ng', 'Sinfonia', '', '', 0, 1, 0, '2010-11-29 19:48:39', '2015-03-12 13:44:38', '0000-00-00 00:00:00'),
(29856, 24365, 0, 1, '死小孩', '我被路上的國中生幹醮', '2002-05-01 00:00:00', 2000, 0, 1, 10, '有天在路上騎機車\r\n看到路旁有一個小學生\r\n他轉頭像我這裡看過來\r\n對我大罵了一句三字經\r\n\r\n死小孩,他媽的死小孩\r\n\r\n我整個懶趴火都冒起來\r\n機車騎過去停下來\r\n把這兔崽子給他抓起來\r\n一掌就這樣給他八下去\r\n\r\n死小孩,他媽的死小孩', '', 124, '', '離子分裂', '離子分裂', '', '', '', 0, 1, 0, '2010-11-29 20:34:22', '2015-03-12 13:44:38', '0000-00-00 00:00:00'),
(29857, 24365, 0, 1, '病態', '這是個餛飩又羨屎的社會', '2002-05-01 00:00:00', 2000, 0, 1, 7, '今天早上俺生病了\r\n看新聞社會也病了\r\n看發現頻道生態也病了\r\n看錄影帶才知道錄影機壞了\r\n\r\n政治  病了\r\n經濟  病了\r\n人類  病了 \r\n老人年輕人全都病了\r\n\r\n我不想在生存這個病窟中\r\n看著社會每天無情的改變\r\n以前世界大同民生均富的理想\r\n現在只剩政客們狗屁的鬥爭\r\n\r\n別再墮落了人們\r\n別再祈禱了人們\r\n別再分歧了人們\r\n團結點吧', '', 94, '', '離', '離子分裂', '', '', '', 0, 1, 0, '2010-11-29 20:38:01', '2015-03-12 13:44:38', '0000-00-00 00:00:00'),
(29858, 24365, 0, 1, '要你命3000', '法克的台灣上班責任制,他媽的我就是要下班', '2010-02-01 00:00:00', 2000, 0, 1, 10, '趕緊點,時間快到了\r\n要做甚麼,廢話當然是下班了啊\r\n責任制,變調的責任制,沒做完不能下班,馬的那提早做完可不可以提前走\r\n\r\n去告訴你老闆,我要下班\r\n去告訴你老闆,我要下班\r\n去告訴你老闆,我要下班\r\n去告訴你老闆,我肚子餓了,7點了耶\r\n\r\n喂!你的老闆說:你平時怎麼都那麼早走\r\n你以為早上7點喔\r\n賺錢性命也要顧啊\r\n明天又不是放假,人是免休息喔', '', 54, '', '離子分裂', '離子分裂', '', '', '', 0, 1, 0, '2010-11-29 20:39:30', '2015-03-12 13:44:38', '0000-00-00 00:00:00'),
(29859, 24365, 0, 1, '衝出去吧', '與其做夢不如衝出去吧', '2010-02-01 00:00:00', 2000, 0, 1, 10, '你在想甚麼,都甚麼時候了還在那邊猶豫不決\r\n別再考慮了,只要決定好一切就放手一搏去吧\r\n還不快去做,沒那麼多時間讓你在那邊準備了\r\n就是現在,就這樣硬著頭皮衝出去吧\r\n\r\nJust do it right now\r\nJust do it right now\r\nJust do it right now\r\nJust do it right now\r\n\r\n歲月不留人 你的青春歲月一年一年的過去了\r\n時間不等人 你的熱血時光一分一秒的流失了\r\n你在等甚麼 還在那邊等發便當喔\r\n就是現在,就這樣夾著懶啪衝出去吧', '', 93, '', '離子分裂', '離子分裂', '', '', '', 0, 1, 0, '2010-11-29 20:42:04', '2015-03-12 13:44:38', '0000-00-00 00:00:00'),
