(29863, 84478, 0, 1, '不想安靜', '不知道這樣算不算抄襲?', '2010-11-30 00:00:00', 2000, 0, 1, 6, '\r\n不想安靜\r\n\r\n詞曲唱:零九\r\n\r\n我只有鋼琴陪我彈了一夜 \r\n\r\n不小心又想起 牽手陪我的都只是曾經\r\n \r\n我想我還是 不懂你要些什麼\r\n\r\n感情怎麼能用玩笑說\r\n\r\n可不可以不要說愛我\r\n\r\n不要隨便給我承諾\r\n\r\n如果真的沒有捨不得\r\n\r\n我會逼自己離開\r\n\r\n我不想安靜的就走 沒辦法那麼快放手\r\n\r\n我們的 回憶畫面 所有一切 還不停的撥放盤旋\r\n\r\n不想安靜的淚流 不想要你就這樣走\r\n\r\n我會學著放棄你 是因為我太愛你\r\n', '', 274, '', '陳零九 我該打周先生嗎', '陳零九 我該打周先生嗎', '陳零九 我該打周先生嗎', '陳零九 我該打周先生嗎', '', 0, 1, 0, '2010-11-30 07:28:20', '2015-03-12 13:44:38', '0000-00-00 00:00:00'),
